
                                                               '<p><img src="data:image/jpeg;base64,"></p><p>	Backed by BMW, Baillie Gifford, Goldman Sachs, VW and Tesla, Northvolt’s ambition is to redress the imbalance of EV battery&nbsp;production between Europe and Asia.</p><p>Northvolt says it has already got orders worth $30 billion from VW, BMW, Polestar and Volvo.</p><p>	Northvolt’s battery factory is at Skelkeftea in the north of Sweden.</p><p>The company’s aim is to have annual output of 150GWh by 2030.</p>',
                                                               'admin', '2021-11-14 22:22:34'),

                                                              ('4645d7c7-264f-4206-b31b-89327b2fa1cb', 'Raspberry Pi adds Trilobot', 'Electronics',
                                                               '<p><img src="data:image/jpeg;base64,"></p><p>Trilobot’s chassis is made of layers of resilient FR-4 PCB.&nbsp;The motor driver hardware is built right into the chassis itself so you don’t need a separate HAT to handle the motors.</p><p>It has a blingy gold bumper and a stylish reversible top plate. Bright onboard RGB LED underlighting&nbsp;is built in as standard.</p><p>	Adding a Raspberry Pi camera attached to the built-in camera mount allows the recording of a robot’s eye view.</p><p>	It comes with an ultrasonic distance sensor&nbsp;so it can stop itself from bumping into things&nbsp;but it’s easy to add more – there’s two connectors for plugging in breakouts with Qwiic or STEMMA QT connectors, and broken out headers for adding up to five sockets for&nbsp;<a href="https://shop.pimoroni.com/collections/breakout-garden" rel="noopener noreferrer" target="_blank" style="color: rgb(19, 100, 135);">Breakout Garden</a>&nbsp;breakouts (requires soldering).</p><p>The hardware is supported by a fully-featured&nbsp;<a href="https://github.com/pimoroni/trilobot-python/" rel="noopener noreferrer" target="_blank" style="color: rgb(19, 100, 135);">Python library</a>, with controller code and lots of examples developed with the help of a top-tier Trilobot testing team.</p><p>For £48 you get the the Trilobot Base Kit,&nbsp;you’ll need to add&nbsp;your own Raspberry Pi, SD card, camera and battery bank.</p><p><strong>Features</strong></p><ul><li>2x front wheel drive, 1x rear castor</li><li>Four tactile buttons and status LEDs</li><li>Six-zone RGB underlighting!</li><li>Front facing ultrasound distance sensor and camera mount (camera sold separately).</li><li>2x Qw/St (Qwiic / STEMMA QT) connectors</li><li>Hackable headers for expansion – a servo header, 5x headers for mounting Breakout Garden sockets (sold separately), 1x I2C header</li><li><a href="https://cdn.shopify.com/s/files/1/0174/1800/files/trilobot_schematic.pdf?v=1639566970" rel="noopener noreferrer" target="_blank" style="color: rgb(19, 100, 135);">Schematic</a></li><li>Mechanical drawings:&nbsp;<a href="https://cdn.shopify.com/s/files/1/0174/1800/files/trilobot_main_board_drawing.pdf?v=1639566969" rel="noopener noreferrer" target="_blank" style="color: rgb(19, 100, 135);">Main</a>&nbsp;/&nbsp;<a href="https://cdn.shopify.com/s/files/1/0174/1800/files/trilobot_top_board_drawing.pdf?v=1639566969" rel="noopener noreferrer" target="_blank" style="color: rgb(19, 100, 135);">top</a>&nbsp;/&nbsp;<a href="https://cdn.shopify.com/s/files/1/0174/1800/files/trilobot_front_board_drawing.pdf?v=1639566970" rel="noopener noreferrer" target="_blank" style="color: rgb(19, 100, 135);">front</a>&nbsp;/&nbsp;<a href="https://cdn.shopify.com/s/files/1/0174/1800/files/trilobot_camera_board_drawing.pdf?v=1639566970" rel="noopener noreferrer" target="_blank" style="color: rgb(19, 100, 135);">camera</a></li><li><a href="https://github.com/pimoroni/trilobot-python/" rel="noopener noreferrer" target="_blank" style="color: rgb(19, 100, 135);">Python library</a></li></ul><p><strong>The base kit includes</strong>:</p><ul><li>Trilobot main, top, front and camera boards</li><li>2x 110:1 motors with pre-soldered shims</li><li>2x motor cables</li><li>2x grippy moon-buggy wheels</li><li>1x ball castor</li><li>Ultrasonic distance sensor</li><li>Booster header for attaching your Pi</li><li>USB-C power cable for connecting a power bank (not included).</li><li>Associated nuts, bolts and mounting hardware</li></ul><p>To complete your robot, you will also need a&nbsp;<a href="https://shop.pimoroni.com/products/raspberry-pi-4" rel="noopener noreferrer" target="_blank" style="color: rgb(19, 100, 135);">Raspberry Pi 4</a>, a&nbsp;<a href="https://shop.pimoroni.com/products/raspberry-pi-camera-module-v2?variant=19833929735" rel="noopener noreferrer" target="_blank" style="color: rgb(19, 100, 135);">Raspberry Pi v2 camera</a>, a&nbsp;<a href="https://shop.pimoroni.com/products/noobs-32gb-microsd-card-3-1" rel="noopener noreferrer" target="_blank" style="color: rgb(19, 100, 135);">microSD card</a>&nbsp;and a USB-C battery pack.</p><p>A&nbsp;<a href="https://learn.pimoroni.com/article/assembling-trilobot" rel="noopener noreferrer" target="_blank" style="color: rgb(19, 100, 135);">beginner friendly tutorial</a>&nbsp;with plenty of photos to show you how to assemble the Trilobot and how to install the Python library.</p>',
                                                               'admin', '2021-11-14 22:22:34'),


                                                              ('abdee4f9-5763-4afc-85ed-98b2fde1235f', 'JAVA NEWS', 'Others',
                                                               'With the simple web server proposal, a command-line tool would be provided to start a minimal web server that serves static files only. No CGI or servlet-like functionality is available. The tool will be useful for prototyping, ad-hoc coding, and testing, particularly in educational contexts. Goals of the plan include offering an out-of-the-box static HTTP file server with easy setup and minimal functionality, reducing developer activation energy and making the JDK more approachable, and providing a default implementation via the command line together with a small API for programmatic creation and customization. Providing a feature-rich or commercial-grade server is not a goal of the proposal.',
                                                               'admin', '2021-10-14 12:12:33');
